Type Definitions.example:
typedef Node {
  int value;
  int next;
}
Node node_mem[2];
int head = 0;
init {
  atomic {
    node_mem[0].value = 10;
    node_mem[0].next = 1;
    node_mem[1].value = 20;
    node_mem[1].next = -1;
    int temp = head;
    printf("Linked List: ");
    do
    :: (temp != -1) ->
      printf("%d -> ", node_mem[temp].value);
      temp = node_mem[temp].next;
    :: (temp == -1) -> break;
    od;
    printf("NULL\n");
  }
}

